public class InstanceGroupConfigFactory(string resourceName = null, Action<Humidifier.EMR.InstanceGroupConfig> factoryAction = null) : ResourceFactory<Humidifier.EMR.InstanceGroupConfig>(resourceName)
{

    internal List<InnerInstanceGroupConfigConfigurationFactory> ConfigurationsFactories { get; set; } = [];

    internal InnerInstanceGroupConfigAutoScalingPolicyFactory AutoScalingPolicyFactory { get; set; }

    internal InnerInstanceGroupConfigEbsConfigurationFactory EbsConfigurationFactory { get; set; }

    protected override Humidifier.EMR.InstanceGroupConfig Create()
    {
        var instanceGroupConfigResult = CreateInstanceGroupConfig();
        factoryAction?.Invoke(instanceGroupConfigResult);

        return instanceGroupConfigResult;
    }

    private Humidifier.EMR.InstanceGroupConfig CreateInstanceGroupConfig()
    {
        var instanceGroupConfigResult = new Humidifier.EMR.InstanceGroupConfig
        {
            GivenName = InputResourceName,
        };

        return instanceGroupConfigResult;
    }
    public override void CreateChildren(Humidifier.EMR.InstanceGroupConfig result)
    {
        base.CreateChildren(result);

        result.Configurations = ConfigurationsFactories.Any() ? ConfigurationsFactories.Select(x => x.Build()).ToList() : null;
        result.AutoScalingPolicy ??= AutoScalingPolicyFactory?.Build();
        result.EbsConfiguration ??= EbsConfigurationFactory?.Build();
    }

} // End Of Class

